var qrcode = new QRCode("qrcode", {
    width: 120,
    height: 120,
});

function makeCode() {
    var elText = document.getElementById("surl");
    qrcode.makeCode(elText.value);
}

makeCode();



$("#surl").on("blur", function () {
    makeCode();
    var aa = $('#surl').val();
    var bb = $('#name').val();
    if (aa != '' && bb !='' ) {
        $('#button').removeClass('hide')
    }
    else if(aa == '' || bb =='') {
        $('#button').addClass('hide')
    }

}).on("keydown", function (e) {
    if (e.keyCode == 13) {
        makeCode();
    }
});

$("#name").on("blur", function () {
    var aa = $('#surl').val();
    var bb = $('#name').val();
    if (aa != '' && bb !='' ) {
        $('#button').removeClass('hide')
    }
    else if(aa == '' || bb =='') {
        $('#button').addClass('hide')
    }

});



$(function () {
    setTimeout(function () {
        var biz = $('#qrcode img').attr('src');
    }, 2000);
});

$('#button').click(function () {
    var doc = new jsPDF();
    var biz2 = $('#qrcode img').attr('src');
    var imgData = '';
    doc.addImage(imgData, 'JPEG', 0, 0, 210, 297);
    doc.addImage(biz2, 'PNG', 153.695, 259.395, 17.159, 17.159);


    var name = $('#name').val();
    var title = name + " 従業員様限定！";
    var surl = $('#surl').val();

    var Koharuiro = "";
    doc.addFileToVFS("Koharuiro_Sunray.ttf", Koharuiro);
    doc.addFont('Koharuiro_Sunray.ttf', 'Koharuiro', 'Regular');
    doc.setFont('Koharuiro', 'Regular'); // set font
    doc.setFontSize(42);
    doc.setTextColor(255, 255, 255);
    doc.text(title, 105, 15.5, null, null, 'center');
    doc.setFontSize(40);
    doc.setTextColor(0, 0, 0);
    doc.text(name, 105, 257.281, null, null, 'center');


    var AndaleMono = "";
    doc.addFileToVFS("AndaleMono.ttf", AndaleMono);
    doc.addFont('AndaleMono.ttf', 'AndaleMono', 'Regular');
    doc.setFont('AndaleMono', 'Regular'); // set font
    doc.setFontSize(16);
    doc.text(surl, 77.66, 274.202, null, null, 'center');
    doc.save(name);


});